import {useEffect,useState} from "react"
const PostPage = () => {
   let [data, setData] = useState([]);
   let [search, setSearch] = useState("");  
   useEffect( () => {
       fetch("http://api.giphy.com/v1/gifs/search?q=funny+cat&api_key=dc6zaTOxFJmzC").then((res)=>{
           res.json();
       }).then((data)=>{
           setData(data);
       })
    }, [])

    return (
    <div className="container">
      <div className="wrapper">
        <div className="content">
          <span className="material-icons-outlined profile"> account_circle </span>
          <textarea
            placeholder="Write something here..."
            spellcheck="false"
            className="post_area"
            required
          ></textarea>
          <div className="theme-emoji">
            <span className="material-icons-outlined emoj"> mood </span>
          </div>
        </div>
        <div className="opt">
          <div classNameName="list_1">
            <div classNameName="tgs">
              <span classNameName="material-icons-outlined loyalty"> loyalty</span>
              <p>tag friends</p>
            </div>
            <div className="gif" onClick={()=>{
              
            }}>
              <span className="material-icons-outlined gif_box">gif_box</span>
              <p>GIF</p>
            </div>
          </div>

          <div className="list_2">
            <div className="loc">
              <span className="material-icons-outlined location">location_on</span>
              <p>check in</p>
            </div>
            <div className="event">
              <span className="material-icons-outlined event_note">event_note</span>
              <p>tag event</p>
            </div>
          </div>
        </div>
        <div className="btns">
          <button className="btn_post_only">
            <span className="material-icons-outlined lock"> lock </span>Only me
          </button>
          <button className="btn_post">Post</button>
        </div>
      </div>
    </div>
  );
};

export default PostPage;
